import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Add} from './Add.js';
import {Home} from './Home.js';
import {Routes, Route, useNavigate} from 'react-router-dom';

function App() {
  const navigate = useNavigate();
  const News = () => {
    navigate('./News.js');
  };
  return (
    <div className="App">

      <div>

      <nav class="navbar navbar-light bg-light">
                    <div class="container-fluid">
                         <a class="navbar-brand" href="#">
                             <img src="https://m.media-amazon.com/images/I/41MOEFEt3eL._AC_.jpg" alt="" width="30" height="24" class="d-inline-block align-text-top"/>
                                 Dheeraj
                         </a>
                    </div>
      </nav>
      </div>
      <div>
       <Home/>
      </div>
      <div>
        <Add/>
      </div>
     <div>
     <button onClick={News}>click here for trendy newz</button>
     </div>
    </div>

  );
}

export default App;
